import React from 'react';
import {
  Box,
  UnorderedList,
  ListItem,
  ModalBody,
  Image,
  Button,
  Link,
  HStack,
  useColorModeValue,
  Code,
  Heading,
} from '@chakra-ui/react';

import { BsPlay, BsFileEarmarkCode, BsNewspaper } from 'react-icons/bs';

const Webapps = () => {
  const firstColor = useColorModeValue('red', 'yellow');
  //   const secondColor = useColorModeValue('teal', )
  return (
    <Box mt={2}>
      <ModalBody>
        <Box>
          <Button
            leftIcon={<BsNewspaper />}
            colorScheme="teal"
            size="lg"
            mr={5}
          >
            <Link
              as="a"
              _hover={{ textDecor: 'none' }}
              href="https://arxiv.org/abs/2010.04671"
              isExternal={true}
            >
              Research Paper
            </Link>
          </Button>
          <Button
            leftIcon={<BsPlay />}
            colorScheme={firstColor}
            size="lg"
            mr={5}
          >
            <Link
              as="a"
              _hover={{ textDecor: 'none' }}
              href="https://autocomplete-me.herokuapp.com/"
              isExternal={true}
            >
              Try Now
            </Link>
          </Button>
          <Button leftIcon={<BsFileEarmarkCode />} colorScheme="blue" size="lg">
            <Link
              as="a"
              _hover={{ textDecor: 'none' }}
              href="https://github.com/kevinlin1/nifty-web-apps"
              isExternal={true}
            >
              View Source Code
            </Link>
          </Button>
        </Box>
        Hello!
      </ModalBody>
    </Box>
  );
};

export default Webapps;
